    "2015-07-16T21:37:44.074922",nt"name": "114th-congressional-districts-national",nt"isopen":
    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) (NTAD 2015) are an extract of selected geographic and cartographic
    information from the U.S. Census Bureau's Master Address File / Topologically Integrated
    Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The MTDB represents
    a seamless national file with no overlaps or gaps between parts, however, each TIGER/Line
    shapefile is designed to stand alone as an independent data set, or they can be
    combined to cover the entire nation. Congressional Districts are the 437 areas from
    which people are elected to the U.S. House of Representatives. After the apportionment
    of congressional seats among the States based on census population counts, each
    State is responsible for establishing congressional districts for the purpose of
    electing representatives. Each congressional district is to be as equal in population
    to all other congressional districts in a State as practicable. The congressional
    districts for the 114th Congress (January 2015 to 2017) are the second Congressional
    Districts based on 2010 Census data. The TIGER/Line shapefiles for the District
    of Columbia, Puerto Rico, and the Island Areas (American Samoa, Guam, the Commonwealth
    of the Northern Mariana Islands, and the U.S. Virgin Islands) each contain a single
    record for the non-voting delegate district in these areas. The boundaries of all
    other congressional districts are provided to the Census Bureau through the Redistricting
    Data Program (RDP).",nt"license_title": null,nt"extras": [{ntt"key":
